function externalLinks(){for(var t=document.getElementsByTagName("a"),e=0;e<t.length;e++)t[e].getAttribute("href").startsWith("http")&&0==t[e].getAttribute("target").startsWith("_self")&&(t[e].target="_blank")}function getBaseUrl(){let t=window.location;t.protocol,t.host}externalLinks(),getBaseUrl();